import React from 'react';
import "./Pages.css"

const Programming = () => {
    return (
    <div>
        <h1 className='title'>Software and Programming Projects</h1>
        <h3 className='body'>This page details some of the programming projects I've worked on both individually and with teammates</h3>
    </div>
    );
}
export default Programming;
